import React from 'react';

const Main = () => {
    return (
        <main className="flex flex-col items-center py-20">
            <h1 className="text-4xl font-bold text-gray-800 mb-4">Nillion Search Page</h1>
            <p className="text-lg text-gray-600 mb-8">Your AI-powered assistant to find information quickly.</p>
            
            <form className="flex items-center w-full max-w-md mb-6">
                <input type="text" className="flex-grow p-2 border border-gray-300 rounded-l-md focus:outline-none focus:ring-2 focus:ring-blue-500" placeholder="Search..." />
                <button type="submit" className="bg-blue-500 text-white p-2 rounded-r-md hover:bg-blue-600 transition duration-300">Search</button>
            </form>
            
            <div className="flex flex-col items-center">
                <p className="text-gray-700">Need help?</p>
                <div className="flex space-x-4 mt-4">
                    <a href="#" className="text-blue-500 hover:underline">Help Center</a>
                    <a href="#" className="text-blue-500 hover:underline">Contact Support</a>
                </div>
            </div>
        </main>
    );
};

export default Main;
